Per cominciare ad usare jQuery, dobbiamo inizializzare la libreria. Andiamo sul nostro file JavaScript e aggiungiamo il seguente snippet di codice. var init = function() { alert("JS test with Jquery");
} $(document).ready(init); Vediamo in dettaglio cosa abbiamo fatto. Partiamo dall'ultima riga. $(document).ready(init); Il simbolo $ è il nome della variabile oggetto messa a disposizione dalla libreria jQuery. In JavaScript infatti, il dollaro è un carattere valido per l'inizio di una nome di una variabile o funzione. jQuery mette a disposizione solo la variabile $ . Pubblicare una sola variabile è una cosa molto comune in JavaScript, come vedremo. La variabile document è invece messa a disposizione dal browser e contiene tutte le informazioni che riguarda la pagina html e i relativi fogli di stile CSS. È il nostro punto di contatto tra l'html e gli script JavaScript. L'espressione $(document) serve a inizializzare la libreria jQuery con il documento corrente. In questo modo inoltre jQuery prende il controllo del documento, e noi non andremo mai più ad usare la variabile document direttamente, ma passeremo sempre attraverso l'oggetto $() . Immediatamente dopo l'inizializzazione viene chiamato il metodo .ready() , che richiede come parametro una funzione . Passare come parametri funzioni è una cosa estremamente comune in JavaScript, e anche noi la useremo estensivamente. Il metodo ready invocherà la funzione passatagli come parametro, nel nostro caso init , quando il caricamento della pagina sarà completo e quindi saremo pronti per il processamento del documento. Vediamo ora come abbiamo dichiarato la funzione init . var init = function() { alert("JS test with Jquery");
} Facciamo particolare attenzione a questa sintassi. Abbiamo dichiarato la variabile init , ed abbiamo usato l'operatore di assegnazione (il simbolo = ) per assegnarli come valore una funzione. In questo modo abbiamo di fatto creato una variabile che può essere invocata come una funzione (ovvero con le parentesi tonde, init() ). La funzione dichiarata in questo modo non ha un nome suo, infatti non c'è nessun identificativo fra la keyword function e le parentesi tonde che seguono. Questo tipo di funzioni si chiamano anonime , in inglese anonymous-functions . Chi vuole approfondire può leggere questo articolo . Se ora ricarichiamo la pagina, otteniamo un comportamento molto simile al procedente.

16.body:
Prima di andare avanti, è bene impostare correttamente il file JavaScript. Questo linguaggio infatti lascia moltissima libertà ai programmatori nell'organizzazione del codice, e questa è una buona cosa perché è possibile creare librerie e framework molto potenti, ma senza un po' di disciplina si finsce con lo scrivere del codice che è completamente non mantenibile e soggetto ad infiniti tipi di bug. Rimandiamo al link all'inizio di questa pagina per una syle-guide. Fate particolare attenzione quando copiate-incollate codice da Internet. Assicuratevi che sia scritto bene, e che segua le vostre convenzioni. Alcune stime non ufficiali dicono che l'80% del codice JavaScript reperibile su Internet è monnezza, quindi state in guardia. Per cominciare, bisogna sapere che le variabili in JavaScript dichiarate con var hanno uno scope di funzione , ovvero sono visibili in tutta la funzione in cui sono state dichiarate, indipendentemente dal file o dal blocco in cui si trovano . Cosa significa in pratica? Significa che i seguenti due snippet di codice sono equivalenti: function() { var myName = "Harry"; if (myName == "Harry") { var myFriend = "Ron"; alert("myFriend name is "+ myFriend); }
} function() { var myName = "Harry"; var myFriend = "Ron"; if (myName == "Harry") { alert("myFriend name is "+ myFriend); }
} Come vedete, la variabile myFriend è salita fino in cima alla funzione, uscendo dallo scope dell' if da cui era definita. Questo è un comportamento inusuale, rispetto ad altri linguaggi, e potenzialmente rischioso! Infatti si rischia un conflitto di nomi tra variabili dichiarate anche lontano fra loro. Questo comportamento si chiama hoisting . Vedi la documentazione ufficiale per dettagli. La cosa è particolarmente pericolosa se si dichiarano variabili al di fuori di tutte le funzioni. Cosa succede in questo caso? Le variabili vanno a finire nella funzione globale del browser, che si chiama window() . Come sappiamo, le variabili globali sono estremamente pericolose perché potrebbero andare in conflitto in qualsiasi momento e in modo imprevedibile con altre variabili dichiarate chissà dove, da noi o da altre librerie. Per evitare il più possibile di usare variabili globali, ci sono varie strategie. Noi ne useremo una semplice e molto diffusa: dichiariamo un unica variabile globale con lo stesso nome del file mettiamo tutte le variabili (stringhe, numeri, funzioni e altri oggetti) come proprietà e metodi di questo oggetto Se avete fatto attenzione, questo è anche il metodo usato da jQuery con la sua variabile $ .

